export const discountFormRules = (vm: any) => {
  return {
    'formValue.activity_name': {
      rules: [
        {
          validator: (field: any, value: any, values: any) => {
            if (!value) {
              return '请输入活动名称'
            }
          }
        }
      ]
    },
    'formValue.limit_course_num': {
      rules: [
        {
          validator: (field: any, value: any, values: any) => {
            if (!value) {
              return '请输入限定课时'
            }
          }
        }
      ],
      initialValue: 1
    },
    'formValue.start_time': {
      rules: [
        {
          validator: (field: any, value: any, values: any) => {
            if (!value) {
              return '请选择活动开始时间'
            }
          }
        }
      ]
    },
    'formValue.end_time': {
      rules: [
        {
          validator: (field: any, value: any, values: any) => {
            if (!value) {
              return '请选择活动结束时间'
            }
          }
        }
      ]
    }
  }
}
